import React from 'react';

const Home = () => {
    return (
      <section className="bg-gray-200 py-8">
        <div className="container mx-auto px-4">
          <h2 className="text-2xl font-bold mb-4">Accueil</h2>
          <p>Bienvenue sur mon portfolio !</p>
        </div>
      </section>
    );
  };

export default Home;
